// Function to remove empty <p> elements
function removeEmptyParagraphs() {
    // Use MutationObserver to listen for changes in the DOM
    const observer = new MutationObserver((mutationsList) => {
        mutationsList.forEach((mutation) => {
            // Check added or updated nodes
            mutation.addedNodes.forEach((node) => {
                if (node.nodeType === Node.ELEMENT_NODE) {
                    // If the added node is a <p> and has empty innerText, remove it
                    if (node.tagName === 'P' && node.innerText.trim() === '') {
                        node.remove();
                    }

                    // Check for empty <p> elements within this node's children
                    const emptyParagraphs = node.querySelectorAll('p');
                    emptyParagraphs.forEach((p) => {
                        if (p.innerText.trim() === '') {
                            p.remove();
                        }
                    });
                }
            });
        });
    });

    // Start observing the document body for child node changes
    observer.observe(document.body, {
        childList: true, // Observe direct children being added/removed
        subtree: true,   // Observe all descendants
    });

    console.log('Observer started: Listening for changes to remove empty <p> elements.');
}

// Call the function to start observing
removeEmptyParagraphs();
